import React from 'react';
import ReactDOM from 'react-dom'
import { faInstagram } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

function Footer() {
  return (
    <footer className="py-16 text-grey-darker text-sm text-gray-500 bg-gray-900 text-center">
      <p>Designed and built by Katherine Reyes. Â©2019 All rights reserved.</p>
      <ul class="inline-flex">
        <li><a href="https://www.instagram.com/hyper.yolo/" class="text-gray-100 hover:text-pink-200 mx-2"><FontAwesomeIcon icon={faInstagram} /></a></li>
        <li><a href="https://dribbble.com/klreyes" class="text-gray-100 hover:text-pink-200 mx-2"><i class="fab fa-dribbble"></i></a></li>
        <li><a href="mailto:klong128@gmail.com" class="text-gray-100 hover:text-pink-200 mx-2"><i class="far fa-envelope"></i></a></li></ul>
    </footer>
  );
}

export default Footer;
